import { DataProvider } from "./DataContext/DataContext";
import {BrowserRouter,Route,Routes} from 'react-router-dom';


function App() {

  return (
    <DataProvider>
     <BrowserRouter>
        <Routes>
          <Route path="/" />
        </Routes>
     </BrowserRouter>
    </DataProvider>
  );
}

export default App;
